post_text:
Meal location update:
Meals will be provided free of charge to anyone in the county 18 years of age or younger. These meals will be available each weekday at five school sites and at six neighborhood locations beginning tomorrow, Monday. Meals can be picked up from 11 a.m. to 1 p.m. at Beaufort Middle School, Bogue Sound Elementary School, Down East Middle School, Morehead City Primary School and Newport Elementary School, as well as:
Blue Point Bay Apartments, 201 Old Murdoch Rd, Morehead City;
Carteret Court Apartments, 510 Carteret Ave, Beaufort;
Crystal Coast Apartments, 2109 Mayberry Loop Rd, Morehead City;
East Carolina Housing Authority - Macon Court Apartments, 2204 Bay St., Morehead City;
Eastport at the Park, 498 Campen Rd, Beaufort; and
Beaufort Housing Authority, 716 Mulberry St., Beaufort.
Students will be given a lunch and breakfast for the next day each day. There is a possibility of adding other meal drop off locations.

